// src/pages/Questionnaire/Questionnaire.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Questionnaire.css';

// You can later move this to a separate questions file or fetch from backend
const questions = [
  {
    id: 1,
    question: "üßπHow clean do you like your shared spaces to be?",
    field: "cleanliness",
    options: [
      { text: "‚ú®I need everything super tidy! ", value: 10 },
      { text: "Moderately clean is perfect", value: 7 },
      { text: "A little mess is cozy", value: 4 },
      { text: "Chaos is my comfort zone üòÖ", value: 2 },
    ],
  },
  {
    id: 2,
    question: "üí§What's your ideal sleep schedule? ",
    field: "sleep",
    options: [
      { text: "Early bird ~ 10pm to 6am", value: 10 },
      { text: "Pretty flexible!", value: 7 },
      { text: "Night owl ~ midnight or later", value: 4 },
      { text: "Sleep? What's that? üò¥", value: 2 },
    ],
  },
  {
    id: 3,
    question: "How much noise can you handle while relaxing/studying? üéß",
    field: "noise",
    options: [
      { text: "I need almost complete silence", value: 10 },
      { text: "Some background noise is okay", value: 7 },
      { text: "Noise doesn't really bother me", value: 4 },
      { text: "I love lively & noisy vibes!", value: 2 },
    ],
  },
];

const Questionnaire = () => {
  const navigate = useNavigate();
  const [current, setCurrent] = useState(0);
  const [answers, setAnswers] = useState({});
  const [showResults, setShowResults] = useState(false);

  const progress = ((current + 1) / questions.length) * 100;

  const handleOptionSelect = (value) => {
    const field = questions[current].field;
    setAnswers((prev) => ({ ...prev, [field]: value }));

    if (current < questions.length - 1) {
      setCurrent((prev) => prev + 1);
    } else {
      setShowResults(true);
    }
  };

  const calculateCompatibilityScore = () => {
    const total = Object.values(answers).reduce((sum, val) => sum + val, 0);
    const maxPossible = questions.length * 10;
    return Math.round((total / maxPossible) * 100);
  };

  const restartQuestionnaire = () => {
    setCurrent(0);
    setAnswers({});
    setShowResults(false);
  };

  if (showResults) {
    const score = calculateCompatibilityScore();

    return (
      <div className="kawaii-questionnaire">
        <div className="container results-container">
          <div className="header">
            <h1 className="title">Yayy! You're done! üéâ</h1>
            <p className="subtitle">Here's your cozy compatibility vibe~</p>
          </div>

          <div className="score-circle">{score}%</div>

          <div className="button-group">
            <button className="option-btn" onClick={restartQuestionnaire}>
              Let's do it again! üêª
            </button>

            <button className="option-btn" onClick={() => navigate('/matches')}>
              Show me my roomie matches! üíï
            </button>
          </div>
        </div>
      </div>
    );
  }

  const question = questions[current];

  return (
    <div className="kawaii-questionnaire">
      <div className="container">
        <div className="header">
          <h1 className="title">RoomieRadar</h1>
          <p className="subtitle">Let's find your perfect roommate match~ ‚ô°</p>
        </div>

        <div className="progress-bar">
          <div className="progress-fill" style={{ width: `${progress}%` }} />
        </div>

        <div className="question-card">
          <h2 className="question-text">{question.question}</h2>

          <div className="options-container">
            {question.options.map((option, index) => (
              <button
                key={index}
                className="option-btn"
                onClick={() => handleOptionSelect(option.value)}
              >
                {option.text}
              </button>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Questionnaire;
